import React from 'react'
import { connect } from 'react-redux'

import Card from './Card'

const Sum =  props => {

  return (
    <Card title='Sum of Numbers' blue>
      <div>
        <span>
          <span>Result:</span>
          <strong>{10}</strong>
        </span>
      </div>
    </Card>
  )
}


export default connect() (Sum)
